import React, { Component } from 'react';
import {
    MDBNavbar, MDBNavbarBrand, MDBNavbarNav, MDBNavItem, MDBNavLink, MDBNavbarToggler, MDBCollapse, MDBIcon, MDBLink, MDBDropdownToggle, MDBDropdownItem, MDBDropdown, MDBDropdownMenu
} from "mdbreact";
import { BrowserRouter as Router } from 'react-router-dom';
import logo from '../../assets/images/common/logo_quickfood.png'

class HeaderNotLogin extends Component {
    state = {
        isOpen: false
    };

    toggleCollapse = () => {
        this.setState({ isOpen: !this.state.isOpen });
    }
    render() {
        return (
            <Router>
                <MDBNavbar
                    color='info-color'
                    dark
                    expand='md'
                    style={{ marginTop: '20px' }}
                >
                    <MDBNavbarBrand>
                        <strong className='white-text'>MDBNavbar</strong>
                    </MDBNavbarBrand>
                    <MDBNavbarToggler
                        onClick={this.toggleCollapse('navbarCollapse3')}
                    />
                    <MDBCollapse id='navbarCollapse3' isOpen={collapseID} navbar>
                        <MDBNavbarNav right>
                            <MDBNavItem>
                                <MDBLink className='waves-effect waves-light' to='#!'>
                                    <MDBIcon icon='envelope' className='mr-1' />
                    Contact
                  </MDBLink>
                            </MDBNavItem>
                            <MDBNavItem>
                                <MDBLink className='waves-effect waves-light' to='#!'>
                                    <MDBIcon icon='cog' className='mr-1' />
                    Settings
                  </MDBLink>
                            </MDBNavItem>
                            <MDBNavItem>
                                <MDBDropdown>
                                    <MDBDropdownToggle nav caret>
                                        <MDBIcon icon='user' className='mr-1' />
                      Profile
                    </MDBDropdownToggle>
                                    <MDBDropdownMenu className='dropdown-default' right>
                                        <MDBDropdownItem href='#!'>My account</MDBDropdownItem>
                                        <MDBDropdownItem href='#!'>Log out</MDBDropdownItem>
                                    </MDBDropdownMenu>
                                </MDBDropdown>
                            </MDBNavItem>
                        </MDBNavbarNav>
                    </MDBCollapse>
                </MDBNavbar>
            </Router>
        );
    }
}

export default HeaderNotLogin;
